// Loads the public key
void load_public_key(unsigned int bram_id) {
    for (unsigned int i = 0; i < N / 2; i++) {
        uint128_t temp = createUint128_t(public_key[i], public_key[i + N / 2]);
        bram_write(&temp, bram_id, i, 1);
    }
}

// Loads the message
void load_message(unsigned int bram_id) {
    for (unsigned int i = 0; i < MESSAGE_BLOCK_COUNT; i++) {
        uint128_t temp = createUint128_t(0, message_blocks[i]);
        bram_write(&temp, bram_id, i, 1);
    }
}

// Loads the signature
void load_signature(unsigned int bram_id) {
    for (unsigned int i = 0; i < SIGNATURE_BLOCK_COUNT / 2; i++) {
        uint128_t temp = createUint128_t(signature_blocks[i * 2], signature_blocks[i * 2 + 1]);
        bram_write(&temp, bram_id, i, 1);
    }
}

void load_into_bram(uint64_t *src, unsigned int bram_id, unsigned int start_addr, unsigned int count) {
    for (unsigned int i = 0; i < count / 2; i++) {
        uint128_t temp = createUint128_t(src[i * 2], src[i * 2 + 1]);
        bram_write(&temp, bram_id, start_addr + i, 1);
    }
}

// Writes count*128bit of data from src to BRAM bram_id at address bram_addr
void bram_write(uint128_t *src, unsigned int bram_id, unsigned int bram_addr, unsigned int count) {
    volatile uint128_t *bram_ptr = (volatile uint128_t *)BRAM_BASE;
    unsigned int bank_offset = bram_id << 13; // Top 3 bits are BRAM id

    for (unsigned int i = 0; i < count; i++) {
        // Enable BRAM access
        *((int *)BRAM_ENABLE_REG) = 0b1;

        bram_ptr[bank_offset + bram_addr + i] = src[i];

        // Disable BRAM access
        *((int *)BRAM_ENABLE_REG) = 0b0;
    }
}

// Reads count*128 bit of data from BRAM bram_id at address bram_addr to dest
void bram_read(unsigned int bram_id, unsigned int bram_addr, uint128_t *dest, unsigned int count) {
    volatile uint128_t *bram_ptr = (volatile uint128_t *)BRAM_BASE;
    unsigned int bank_offset = bram_id << 13; // Top 3 bits are BRAM id

    for (unsigned int i = 0; i < count; i++) {
        // Enable BRAM access
        *((int *)BRAM_ENABLE_REG) = 0b1;

        dest[i] = bram_ptr[bank_offset + bram_addr + i];

        // Disable BRAM access
        *((int *)BRAM_ENABLE_REG) = 0b0;
    }
}

// Creates an uint128_t from 2 uint64_t values
uint128_t createUint128_t(uint64_t high, uint64_t low) { return ((uint128_t)high << 64) | low; }

void verify() {
    print("Starting verification...\n");
    print("Loading keys, signature, and message...\n");
    load_public_key(BRAM0);
    load_signature(BRAM1);
    load_message(BRAM6);
    print("Keys, signature, and message loaded.\n");

    print("Starting verification...\n");

    // Set the algorithm to verify
    *((int *)ALGORITHM_SELECT_REG) = 0b1;

    // Start verify
    *((int *)START_REG) = 0b1;

    // Wait for the verification to complete
    while (*((int *)POLL_DONE_REG) == 0)
        ;

    if (*((int *)POLL_DONE_REG) & SIGNATURE_ACCEPTED_MASK)
        print("Signature accepted\n");
    else if (*((int *)POLL_DONE_REG) & SIGNATURE_REJECTED_MASK)
        print("Signature rejected\n");
    else
        print("Unknown status\n");
}

void sign() {
    print("Starting signing...\n");
    print("Loading b00, b01, b10, b11 and tree...\n");
    load_into_bram(b00, BRAM0, 0, N);
    load_into_bram(b01, BRAM1, 0, N);
    load_into_bram(b10, BRAM2, 0, N);
    load_into_bram(b11, BRAM3, 0, N);
    load_message(BRAM4);
    load_into_bram(tree, BRAM6, 0, TREE_SIZE);

    print("b00, b01, b10, b11 and tree loaded.\n");

    print("Starting signing...\n");

    // Set the algorithm to sign
    *((int *)ALGORITHM_SELECT_REG) = 0b0;

    // Start sign
    *((int *)START_REG) = 0b1;

    // Currently doesn't yet wait for it to finish
}

