    bram_read(BRAM3, 0, arr, 2 * N);
    bram_read(BRAM4, 0, arr, 2 * N);
    bram_read(BRAM5, 0, arr, 2 * N);
    bram_read(BRAM6, 0, arr, 2 * N);

    print("Done\n");

